import React from 'react';
import BookingForm from '../components/BookingForm';
import Schedule from '../components/Schedule';
import DemoVideos from '../components/DemoVideos';
import PaymentIntegration from '../components/PaymentIntegration';


const Home: React.FC = () => {
    return (
        <div className="home-container">
            <header className="hero-section">
                <h1>Welcome to My Personal Branding Website</h1>
                <p>Your journey to learning starts here!</p>
                <button className="cta-button">Get Started</button>
            </header>
            <section className="section book-class">
                <h2>Book a Class</h2>
                <BookingForm />
            </section>
            <section className="section class-schedule">
                <h2>Class Schedule</h2>
                <Schedule />
            </section>
            <section className="section demo-videos">
                <h2>Demo Videos</h2>
                <DemoVideos />
            </section>
            <section className="section payment-options">
                <h2>Payment Options</h2>
                <PaymentIntegration />
            </section>
        </div>
    );
};

export default Home;
